import React from 'react';

const Add = ({addNew, name, number, nameHandler, numberHandler}) => {

<form onSubmit={addNew}>
<div>
  name: <input name={name}
  handleName={nameHandler}
  />
</div>
<div>
  number: <input number={number}
  handleNumber={numberHandler}
  />
</div>
<div>
  <button type="submit">add</button>
</div>
</form>

}

export default Add;
